INSERT IGNORE INTO `afisha` (`id`, `place_id`, `city_id`, `place_name`, `name`, `print_name`, `print_name_small`, `text`, `alias`, `event_date`, `event_time`, `cost_from`, `cost_to`, `add_field`, `image`, `main_show`, `status`, `views`, `sort`, `parent_id`, `created_at`, `updated_at`, `url`) VALUES
	(50, 1, NULL, NULL, 'Rock symphony', '', '', '<p>"Рок Симфония" звучит очень целостно, треки незаметно меняются один на другой, формируя единое монолитное&nbsp;произведение.<br />Слияние виртуозных инструментов хора и оркестра создает непередаваемые ощущения.<br />Эмоции на концерте меняются от бурного восторга до тихого лирического наслаждения мелодичными звуками.<br />Впечатления от каждой следующей композиции наслаиваются на впечатление от предыдущих, и в самом конце звучит стремительный, динамичный, виртуозно финал, подрывая эмоции и доставляя истинным ценителям эмоциональной музыки непередаваемое удовольствие!</p>\r\n<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/OGvk4nik18Q" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', 'rock_symphony', 1456246800, '19:00', NULL, NULL, '', 'b03a846b64830f678af3ad5cd467d739.jpg', 1, 1, 1088, 13, 0, 1442167914, 1452271076, NULL),
	(51, NULL, 9, 'Одесса Дворец спорта', 'Scorpions', NULL, NULL, '<p>В Одессе во Дворце Спорта 17 февраля в 19-00</p>\r\n<p>&nbsp;</p>\r\n<p><strong> Справки и заказ билетов в Николаеве по тел (0512) 500-505</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Легендарные &laquo;Sсorpions&raquo; возвращаются в Киев с большим концертом в рамках грандиозного мирового тура 50th Anniversary &mdash; World Tour 2015/2016.</p>\r\n<p>2015 &ndash; юбилейный год для группы &laquo;Sсorpions&raquo;. Команде, которую по праву можно назвать самой востребованной рок - командой, исполнилось 50 лет! Уже полвека &laquo;Scorpions&raquo; символизируют настоящую качественную рок-музыку и потрясающие по своему драйву и энергетике концерты, неизменно сопровождающиеся аншлагами.</p>\r\n<p>Группа &laquo;Scorpions&raquo; с нетерпением ожидает встречи со зрителями и приглашает отметить полувековой юбилей своей истории на живом концерте 19 февраля в киевском Дворце спорта в рамках масштабного мирового турне.</p>\r\n<p>Концерт &laquo;Scorpions&raquo; - это настоящая феерия эмоций и возможность ещё раз услышать легендарные хиты. Сумасшедший драйв, потрясающее шоу &ndash; всё это ждёт тех, кто собирается посетить концерт в Киеве.</p>\r\n<p>Юбилейный 2015 год &laquo;Scorpions&raquo; начали с показа кинофильма &laquo;Forever and a Day&raquo;. Знаменитый режиссер Катя фон Гарнье (&laquo;Бандитки&raquo;, &laquo;Восточный ветер&raquo;) сопровождала &laquo;SCORPIONS&raquo; в их прощальном турне &laquo;Final Sting-Tour&raquo; и за 18 месяцев запечатлела уникальные кадры &ndash; моменты общения между членами группы, их встречи с поклонниками, все forte- и piano-, которые создают магию этой легендарной группы. Перед зрителями фильма раскрывается необычайная история развития группы и дружеских отношений.</p>\r\n<p>За прошедшие десятилетия энергетика &laquo;Scorpions&raquo; и желание играть рок нисколько не утихли. Наоборот, страсть и радость от игры остаются неизменными атрибутами каждого выступления музыкантов до сих пор, доказательством тому является выпуск в 2015 году нового альбома &laquo;Return to Forever&raquo;, песни из которого украинские фанаты смогут услышать вживую уже в феврале.</p>\r\n<p>&laquo;Scorpions&raquo; - самая популярная рок-группа Германии и одна из самых известных групп на мировой рок - сцене, которая продала более 100 миллионов копий альбомов и выступила на 5000 концертах в более 80 странах мира. Коллектив занимает 46-ю строчку в списке &laquo;Величайших артистов хард-рока&raquo; по версии VH1. Группа подарила миру незабываемые рок-хиты, такие как &laquo;Rock You Like a Hurricane&raquo;, &laquo;Wind of Change&raquo;, &laquo;Send Me an Angel&raquo;, &laquo;Still Loving You&raquo;.</p>\r\n<p><strong>Участники группы:</strong></p>\r\n<p><strong>Рудольф Генрих Шенкер</strong>&nbsp;&mdash; немецкий музыкант, основатель группы &laquo;Scorpions&raquo;, её гитарист и композитор. Старший брат Михаэля Шенкера, участника группы в раннем периоде её творчества.</p>\r\n<p><strong>Клаус Майне</strong>&nbsp;- вокалист группы. Принимал участие в записи всех альбомов группы, несмотря на то, что присоединился к &laquo;Scorpions&raquo; только через 4 года после основания. Вместе с Рудольфом Шенкером Клаус является автором большинства песен группы, в том числе наиболее успешной песни группы &mdash; &laquo;Wind of Change&raquo;. В 2006 году занял 22 место в рейтинге 100 лучших метал-вокалистов всех времён по версии американского журнала &laquo;Hit Parader&raquo;.</p>\r\n<p><strong>Маттиас Ябс</strong>&nbsp;- гитарист &laquo;Scorpions&raquo;. Один из самых техничных гитаристов в хард-роке. Британским журналом &laquo;Classic Rock&raquo; включен в список величайших гитаристов всех времен.</p>\r\n<p><strong>Джеймс Коттак</strong>&nbsp;&mdash; американский музыкант, известный как ударник групп &laquo;Scorpions&raquo; и &laquo;Kingdom Come&raquo;, а также как гитарист и вокалист группы &laquo;Kottak&raquo;.</p>\r\n<p><strong>Павел Мончивода</strong>&nbsp;- польский бас-гитарист, c 10 января 2004 года&nbsp; является участником группы &laquo;Scorpions&raquo;. В 2013 году был признан лучшим бас-гитаристом Польской Народной Республики.</p>\r\n<p><strong>Хотите ещё раз услышать гениальную музыку, которая покорила наши сердца? Тогда покупайте билеты на концерт &laquo;Scorpions&raquo;!<br /></strong></p>', 'scorpions', 1455728400, '19:00', 700, 3500, NULL, '38b943b9e43eb6018737787f2157ef35.jpg', 1, 1, 1618, 27, 0, 1442665420, 1447170038, 'http://kassir24.mticket.com.ua/m-ticket/agent86site110/widget/map?siteId=110&showId=2103&eventId=4772'),
	(55, 1, NULL, NULL, 'NOTRE DAME DE PARIS', '', '', '<div style="text-align: center;">&nbsp;КОНЦЕРТ-СЕНСАЦИЯ\r\n<div>\r\n<p align="center"><strong>Les meilleures chansons de<br />NOTRE DAME de PARIS</strong></p>\r\n<p align="center">7 СОЛИСТОВ<br /><strong>БОЛЬШОЙ СИМФОНИЧЕСКИЙ ОРКЕСТР, ХОР и РИТМ-ГРУППА</strong></p>\r\n<p align="center">С максимальным накалом эмоций, то в полумраке, то в ярком свете софитов, в унисон с симфоническим оркестром и хором, чтобы вновь рассказать неповторимую, до боли знакомую и в то же время абсолютно новую историю бессмертной любви.</p>\r\n<p align="center">от продюсеров<br /><strong>ROCK SYMPHONY</strong></p>\r\n<p align="center"><strong>В проекте задействовано 60 артистов и более 10 тонн светового и звукового оборудования.</strong></p>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n<p align="center">Тексты -&nbsp;<strong>Люк Пламондон,&nbsp;</strong>Музыка -&nbsp;<strong>Риккардо Коччианте</strong></p>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n<p align="left">Знаменитая история босоногой цыганки и троих абсолютно по-разному влюбленных в нее мужчин, в своем музыкальном воплощении, на сегодняшний день считается одной из лучших и любимых зрителями. Она занимает заслуженное место под нотным солнцем вместе с такими небезызвестными мюзиклами как &laquo;Призрак Оперы&raquo; или &laquo;Мамма MIA!&raquo;, однако благодаря удивительной красоте французского языка вырывается далеко вперед по уровню эмоционального накала.</p>\r\n<p align="left"><strong>Мюзикл, попавший в Книгу рекордов Гиннесса как самый успешный.</strong></p>\r\n<p align="left">Семь удивительных голосов под надрывы скрипок и плач виолончелей, заставят заново пережить, снова поверить и в который раз влюбиться в красоту.</p>\r\n<p align="left"><strong>Запутавшись в волшебстве прекрасного, зритель получит уникальную возможность эмоционально очиститься, позабыть о тревогах, ощутить неповторимый вкус легенды.</strong></p>\r\n</div>\r\n</div>\r\n<div style="text-align: center;">&nbsp;</div>', 'notre_dame_de_paris', 1455123600, '19:00', NULL, NULL, '', 'aa66e7ffc7e8f2b3400dca78955272c6.jpg', 1, 1, 1757, 7, 0, 1443191953, 1452088857, NULL),
	(61, 1, NULL, NULL, 'Сухишвили', '', '', '<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/t-urTKLJyEw" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>Национальный балет Грузии &laquo;Сухишвили&raquo; был основан в 1945 году Илико Сухишвили и Нино Рамишвили. В Грузии это был первый профессиональный танцевальный ансамбль, на примере которого создавались все последующие. В 30-х годах прошлого века народного танца как такового в Грузии не существовало. Были ансамбли песни и танца Восточной Грузии, Западной Грузии &ndash; пять-шесть человек и репертуар из несколько танцев. Больших коллективов и масштабных постановок в Грузии не было, они появились лишь вместе с созданием ансамбля под руководством Илико Сухишвили. Благодаря стараниям семьи Сухишвили искусство национального танца Грузии стало активно развиваться и завоевывать популярность. Илико и Нино сделали свою мечту реальностью: грузинская культура танца получила мировое признание, а молодые люди стали партнерами не только на сцене, но и в жизни, их дело продолжили дети, а теперь и внуки.<br /><br />Династия Сухишвили руководит коллективом ансамбля на протяжении 3 поколений вот уже 70 лет: I поколение (1945-1985 гг.) &ndash; Нино Рамишвили и Илико Сухишвили, II поколение (1985-2000 гг.) &ndash; Тенгиз и Инга Сухишвили (дети), III поколение (с 2000 года) &ndash; Нино и Илико Сухишвили (внуки).<br /><br />В самом начале балет состоял всего из 35 человек. Позже были гастроли по России, первое признание в Москве и первый выезд заграницу в 1948 году, еще в эпоху Сталина. Тогда ансамбль впервые побывал на гастролях в Европе, а после в Австралии и в Америке, где, выступления &laquo;Сухишвили&raquo; были признаны &laquo;лучшим шоу на Бродвее&raquo;.<br /><br />&laquo;Сухишвили&raquo; стал первым ансамблем народного танца, который выступил на сцене La Scala в Милане &ndash; это случилось еще в 1967 году. Занавес поднимался 14 раз &ndash; рекорд знаменитого тенора Энрике Карузо (11 раз) был побит, а газеты, захлебываясь словами, писали: &laquo;Грузинские артисты балета &ndash; само совершенство!&raquo;, &laquo;Союз мужской бравады и женской грациозности&raquo;, &laquo;Их танец бросает вызов законам гравитации&raquo;.<br /><br />В Англии во время проведения мирового чемпионата по футболу труппа оказала беспрецедентную конкуренцию этому виду спорта, когда фанатами были заполнены концертные залы. Королева Великобритании, восхищенная выступлением, лично вручила золотую медаль Илико Сухишвили.<br /><br />В Индии, сцена, возведенная под открытым небом, обрушилась, и тогда добровольцы из числа зрителей до конца выступления держали ее на плечах. Такого рода воспоминаний в истории ансамбля множество.<br /><br />Слава коллектива становилась поистине мировой. &laquo;Восьмое чудо света&raquo; &ndash; именно так окрестила ансамбль &laquo;Сухишвили&raquo; международная пресса.<br /><br />Сегодня ансамбль состоит из 500 танцоров и собственного оркестра. За всю свою историю коллектив побывал в более чем 250 турне, 11 раз объездил 5 континентов, 88 стран, провел 12 300 концертов, а зрителями представлений труппы стало более 7 миллионов человек.<br /><br />За 70 лет ансамбль множество раз выступал на самых известных мировых сценах.</p>', 'suhishvili', 1458147600, '19:00', NULL, NULL, '', 'a0534c9d8f2dd77f02bedbdff66b398a.jpg', 1, 1, 1400, 15, 0, 1444990565, 1451922016, NULL),
	(63, NULL, 10, 'Киев Stereo Plaza', 'HURTS', '', '', '<p>&nbsp;</p>\r\n<p style="text-align: center;"><strong>Справки и заказ билетов в Николаеве (0512) 500-505</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><br /><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/1TB1x67Do5U" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Hurts</strong>&nbsp;&mdash; английский музыкальный коллектив из Манчестера, образовавшийся в&nbsp;2009 году. Их первые два альбома,<em>Happiness</em>&nbsp;и&nbsp;<em>Exile</em>, попали в десятку лучших альбомов в Великобритании, Германии, Австрии, Швейцарии, Польше и Финляндии.</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>', 'hurts', 1457028000, '20:00', 800, 5000, '', 'c51b02cd4d60bcdd3fa4a6f4bd171025.jpg', 1, 1, 612, 16, 0, 1445025432, 1450347888, 'https://arm.frontmanager.com.ua/PublicApi/Tickets.aspx?__uid=ymHTO0sB02RN1XaBFqRcuA&event=414300212'),
	(70, 1, NULL, 'Областной Дворец Культуры', '13 иллюзий', '13 ИЛЛЮЗИЙ', 'Магическое ШОУ', '<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/bX2IyZsM7yU" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>Областной Дворец Культуры&nbsp;&nbsp;приглашает вас на&nbsp;захватывающее шоу иллюзиона!</p>\r\n<p>Такого вы&nbsp;еще не&nbsp;видели! 11 декабря, грандиозная программа &laquo;13 иллюзий&raquo; от&nbsp;признанных во&nbsp;всем мире непревзойденных украинских магов. Удивлять, очаровывать и&nbsp;завораживать вас будут гениальные Виталий Горбачевский и&nbsp;Виталий Лузкарь.</p>\r\n<p style="text-align: center;"><strong>Справки и заказ билетов по тел (0512) 500-505&nbsp;</strong></p>\r\n<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/2PwvC1e1NNA" width="420" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>Во&nbsp;время их&nbsp;представления атмосфера тайн, загадок, магии, романтики и&nbsp;веселья окутывает зал. Восхищению нет предела! Шок! Смех! Радость! Удивление! Эксклюзив! Здесь вас ждет все, кроме скуки и&nbsp;банальности.</p>\r\n<p>Более двух десятков стран покорили своими незабываемыми выступлениями маги, уже много лет они участвуют в&nbsp;шоу-программах международного уровня.</p>\r\n<p>Виталий Лузкарь&nbsp;&mdash; победитель третьего сезона TV-шоу &laquo;Україна має талант&raquo;, обладатель Приза зрительских симпатий и&nbsp;премии Гран-При на&nbsp;Международном Конкурсе Иллюзионистов (Москва, Россия). Представляет очень красивые номера с&nbsp;белыми голубями породы египетская горлица. Мечтает создать свое иллюзион-шоу. Кумир&nbsp;&mdash; Д. Копперфилд.</p>\r\n<p>Виталий Горбачевский&nbsp;&mdash; учитель В. Лузкаря, обладатель множества престижных наград и&nbsp;премий отечественного и&nbsp;международного уровня: Международного фестиваля фокусников (Монако, Монте-Карло), Mandrake D&rsquo;Or Awards (Париж), World Magic Awards (Лос-Анджелес) и&nbsp;других.</p>', '13_illjuzij', 1449853200, '19:00', 100, 350, '', 'c4b90c589f0b9368980a019989f4e92d.jpg', 1, 1, 2271, 20, 0, 1446048788, 1449853462, ''),
	(76, NULL, 10, 'Киев Клуб Бинго', 'Hollywood Undead', NULL, NULL, '<p>Hollywood Undead выступят в Киеве весной 2016 года</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Справки и заказ билетов в Николаеве (0512) 500-505</strong> и в Центральной театрально-концертной кассе (пл.Судостроителей,3 Областной дворец Культуры)</p>\r\n<p><br />Рэпкор группа из Калифорнии Hollywood Undead&nbsp; приедет в Киев 15 марта и задаст небывалый темп в клубе Бинго. Музыканты привезут&nbsp; в Украину новый альбом Day of the Dead, который был записан на культовом лейбле Interscope records.&nbsp;<br /><br />Hollywood Undead приезжали в 2014 году, отыграв громкий октябрьский концерт в Киеве, вновь посетят столицу Украины уже в марте 2016 года. Группа переживает новый этап в карьере, в то же время, выпустив новую пластинку Day of the Dead, которая отсылает к истокам самого первого релиза Swan songs. Поэтому, Киев ждет двойное возращение &ndash; Hollywood Undead зазвучат по &ndash; новому и с новым смыслом.<br /><br />В 2005 году группа создавалась друзьями-энтузиастами и успела претерпеть изменения в составе. Вокалист Deuce ушел со скандалом, после чего новым вокалистом стал Danny. После этого, группу покинул Shady Jeff, открыв свою сеть заправочных биотопливом. Сегодня группа состоит из 6 участников &ndash; каждый личность, со своей историей, которую доносит в песнях HU до слушателя.<br /><br />Музыку Hollywood Undead можно описать многими стилями, от хип-хопа до ню-метала, каждый раз &ndash; новое звучание. Вся карьера исполнителей &ndash; поиски себя, причем, успешные поиски, ведь 5 млн. проданных копий альбомов по всему миру - тому подтверждение!&nbsp;<br /><br />Музыканты постоянно гастролируют и на каждый концерт одевают маски, созданные ими лично. 15 марта в клубе Бинго Hollywood Undead предстанут перед Киевом в новых масках, с новым альбомом, будто впервые!<br /><br />Дата: 15.03.15<br /><br />Место: клуб &laquo;Бинго&raquo;</p>', 'hollywood_undead', 1458064800, '20:00', 490, 800, NULL, 'aa807cd1daad4a5f0be8d0f3e1685c49.jpg', 1, 1, 191, 18, 0, 1446813611, 1447162264, 'https://arm.frontmanager.com.ua/PublicApi/Tickets.aspx?__uid=ymHTO0sB02RN1XaBFqRcuA&event=430227446'),
	(78, NULL, 1, 'Областной Дворец Культуры', '95-й квартал', '95-й квартал', ' (дополнительный концерт)', '', '95-j_kvartal', 1459785600, '19:00', 400, 1500, '', '99e930cc6ad31736867dbcdf8d46afd7.jpg', 1, 1, 2052, 11, 0, 1447166469, 1451918974, 'https://arm.frontmanager.com.ua/PublicAPI/Tickets.aspx?__uid=XyGK3S44IpEmOTtrFGR44A&event=457751634'),
	(80, 1, NULL, '', 'Зимняя сказка театр теней Teulis', 'Зимняя сказка', 'Театр теней Teulis', '<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="//vk.com/video_ext.php?oid=132107442&amp;id=171617135&amp;hash=be52364f62ff0825&amp;hd=2" width="585" height="329" frameborder="0"></iframe></p>\r\n<p>Спешим порадовать Вас еще одной встречей с мега-популярным ТЕАТРОМ ТЕНЕЙ "TEULIS" !!!<br />Мамы, папы, дедушки и бабушки... берите свою детвору и приходите 8&nbsp;января, в&nbsp;Областной Дворец Культуры<br />Вас ждет новая рождественская программа от ТЕАТРА ТЕНЕЙ "ТEULIS", со сказочной историей для всей семьи!<br />Дед Мороз, Снегурочка и &nbsp;добрые волшебники... покажут Вам увлекательный Мир теней, полный тайн и загадок..</p>', 'zimnjaja_skazka_teatr_tenej_teulis', 1452258000, '15:00', 0, 0, 'Билеты проданы', '2b1f424d6ff5c3e3be4096be947bc001.jpg', 1, 0, 3639, 24, 0, 1447235255, 1452089294, ''),
	(89, 1, NULL, NULL, 'ПРИГЛАСИТЕЛЬНЫЕ ОДК', 'Зимняя сказка', 'Театр теней Teulis', '', 'priglasitelnye_odk', 1452258000, '15:00', NULL, NULL, '', NULL, 1, 0, 5, 22, 0, 1448386058, 1451393045, NULL),
	(91, 1, NULL, NULL, 'resonance', 'группа «résonance»', ' «WHITE TOUR»', '<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/xw7L6De6ObA" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p>Группа &laquo;r&eacute;sonance&raquo;, хоть формально и является камерной частью симфонического оркестра, а также часто причисляемая к ряду современных рок-групп, по сути, не является ни тем, ни другим.</p>\r\n<p>Репертуар группы &ndash; это не просто рок-музыка. Это произведения, которые уже давно вошли в золотой фонд человечества, музыка, созданная самыми талантливыми людьми планеты.<br />Данная программа концерта предлагает новый взгляд на саму суть песни. Отбросив шаблоны, слушатель проникает в самое сердце произведения &ndash; именно то, что композитор изначально в неё вкладывал. И сияние гениальной рок-музыки становится ещё более открытым, а профессиональный подход музыкантов, богатство скрипок, благородность альтов, шарм виолончелей, могущество контрабаса и рок-н-ролльная свобода барабанов делают его насыщенным и красочным, в том числе благодаря проработанным аранжировкам специально для группы &laquo;r&eacute;sonance&raquo;.</p>\r\n<p>Музыканты группы &laquo;r&eacute;sonance&raquo; &mdash; это преподаватели консерваторий, в прошлом музыканты филармоний и оперных театров, гастролирующих по всему миру, а также заслуженные деятели искусств.</p>', 'resonance', 1455037200, '19:00', NULL, NULL, '', 'b3103c9d2919c53b6fa13780a3a1b669.jpg', 1, 1, 805, 12, 0, 1448467801, 1452257775, NULL),
