	(94, NULL, 10, 'НСК Олимпийский', 'Ред Хот Чили Пепперс', '', '', '<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/7qRcNXuvmKc" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', 'red_hot_chili_peppers', 1465228800, '19:00', 700, 1900, '', '40b0ee78047d10a57d0a44f9c6600970.jpg', 1, 1, 216, 25, 0, 1448547035, 1450020146, 'https://arm.frontmanager.com.ua/PublicApi/Tickets.aspx?__uid=ymHTO0sB02RN1XaBFqRcuA&event=443639285'),
	(95, 1, NULL, NULL, 'Двое на Качелях', '«Двое на качелях»', 'Т.Арнтгольц и Г.Антипенко', '<p style="text-align: center;"><iframe src="https://www.youtube.com/embed/Au0gobCL_94" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><iframe src="https://www.youtube.com/embed/20c9I8trNOE" width="420" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="v-rolyah">\r\n<p>В ролях:</p>\r\n<p>Татьяна Арнтгольц</p>\r\n<p>Григорий Антипенко</p>\r\n<p>&nbsp;</p>\r\n<p>Режиссер Алексей Кирющенко</p>\r\n<p>Фотограф Екименков Константин</p>\r\n<p>Продолжительность 2ч. 20 мин</p>\r\n</td>\r\n<td class="spectacl-text">\r\n<p><em>&nbsp; После&nbsp; слова "Любить" сладчайшее слово на свете "Помогать".&nbsp;</em>У.Гибсон</p>\r\n<p>&nbsp;&nbsp; Гитель - занимается танцами, мучается от язвенной болезни, ведет довольно фривольный образ жизни, &nbsp; у нее практически нет денег. Джерри - молодой, амбициозный адвокат, остро переживающий развод с &nbsp; &nbsp; женой. Одна нечаянная встреча&nbsp; перерастает в свидание. . .</p>\r\n<p>&nbsp; &nbsp;Спектакль рассказывает историю любви двух одиноких людей, хватающихся за случайное знакомство, &nbsp; &nbsp; как утопающий за соломинку. Они настолько разные, что невольно возникает вопрос: смогут ли эти &nbsp; &nbsp; &nbsp; &nbsp; двое быть вместе, несмотря на печальный опыт своих прошлых отношений?</p>\r\n<p>&nbsp;</p>\r\n<p>Режиссер:&nbsp;<strong>Алексей Кирюшенко</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'dvoe_na_kacheljah', 1456506000, '19:00', NULL, NULL, '', '852d1b4f08e7bcf606ef9bd4a0f93be3.jpg', 1, 1, 1766, 14, 0, 1448554409, 1449502797, NULL),
