	(100, NULL, 10, 'Киев Stereo Plaza', 'Three Days Grace ', '', '', '<p>Концерт Three Days Grace в Киеве состоится 29 января 2016 г, 19:00.<br /><br /></p>\r\n<p><strong>Справки и заказ билетов в Николаеве по тел.(0512) 500-505</strong></p>\r\n<p>Three Days Grace<br /><br />EasternEuropeantour 2016</p>\r\n<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/jUDzO1E-I8Y" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe><br />&nbsp;<br />Четвёрка душ, пылающих жаркой страстью, чистые сердцем и верные каждому своему слову и каждой сыгранной ноте. С горячей верой в возможность изменить мир вокруг неистовым напором и музыкой. Вам знакомы их мощные гитарные рифы и импульсивный вокал, пост-гранжевые композиции и мелодичные баллады, способные пробиться в самый центр человеческой души.<br /><br />ThreeDaysGrace &ndash; одна из самых популярных альтернативных групп современности. Канадские любимчики критиков MattWalst [вокал], BarryStock [гитара], BradWalst [басс] и NeilSanderson [барабаны, синтезатор] в составе TDG являются постоянными участники всех рок-хит-парадов. Их первый и единственный концерт в Украине &ndash; это новое громкое музыкальное событие нашей страны, и мы никак не можем поверить, что увидим и услышим ThreeDaysGrace на расстоянии вытянутой руки уже совсем скоро.</p>', 'three_days_grace_', 1454086800, '19:00', 500, 1800, '', 'e92be503e3135a316f09fc2b5dbc2d59.jpg', 1, 1, 149, 17, 0, 1449827370, 1449955447, 'https://arm.frontmanager.com.ua/PublicApi/Tickets.aspx?__uid=ymHTO0sB02RN1XaBFqRcuA&event=445357604'),
	(101, 4, NULL, NULL, 'тест', '', '', '', 'test', 1450112400, '19:00', NULL, NULL, '', NULL, 1, 0, NULL, 10, 0, 1450087816, NULL, NULL),
	(102, NULL, 10, 'ВДНХ', 'Atlas Weekend', '', '', '<p style="text-align: center;">Концерт Atlas Weekend в Киеве состоится 08 июля 2016 г, 15:00.</p>\r\n<div class="branding_space">&nbsp;</div>\r\n<div class="content">\r\n<div class="about-event">\r\n<div class="max-wrap">\r\n<div class="text">\r\n<div class="content">\r\n<div class="about-event">\r\n<div class="max-wrap">\r\n<div class="text">\r\n<p>ATLAS WEEKEND: первые имена<br /><br />В продажу поступили билеты на самый громкий музыкальный фестиваль лета 2016.<br /><br />Ежегодный фестиваль ATLAS WEEKEND пройдет 8-9-10 июля в Киеве на ВДНХ. Как и было заявлено ранее, в 2016 фестиваль набирает обороты. Территория становится больше, а лайн-ап разнообразнее!<br /><br />На втором ATLAS WEEKEND соберутся не только представители молодой украинской музыки, но и те, кого меломаны уже много лет мечтают увидеть и услышать в Украине. Самые популярные артисты СНГ и несколько десятков именитых западных команд уже подбирают сетлисты для своего летнего выступления на ATLAS WEEKEND.&nbsp;<br /><br />В течение трех фестивальных дней свои программы на четырех сценах представят музыканты из Украины, России, Беларуси, Европы и США.&nbsp; Никаких жанровых ограничений. Только хорошая музыка!<br /><br />Первые имена:&nbsp;Apocalyptica, GusGus, Иван Дорн, Бумбокс, Друга Ріка, BRUTTO, Pianoбой, Onuka, 5\'nizza, The Maneken, O.Torvald, Валентин Стрыкало, The Retuses, Bahroma, The Erised, Mgzavrebi, Серебряная свадьба, Вагоновожатые, С.К.А.Й., SunSay, Один в Каное, Мария Чайковская, Fl&euml;ur, Brunettes Shoot Blondes, Epolets, Alloise, Сергей Бабкин, PUR:PUR, Biplan, Secret Avenue, Beissoul &amp; Einius, I am waiting for you last summer, Dvoe, Vivienne Mort, Tape Flakes, Fontaliza, Станция Мир.<br /><br />Прекрасным дополнением к музыкальной части ATLAS WEEKEND&nbsp; станут: театральные представления, арт-перформансы, спортивные и детские зоны, десятки открытых локаций с развлечениями и возможностью отдыха для всей семьи, зона ярмарки и маркетов, гастрономическая зона и многое другое.&nbsp;<br /><br />В течение трех дней ATLAS WEEKEND&nbsp; не будет прекращать свою работу ни на минуту. Для тех, кто не захочет покидать опен-ейр даже ночью, на территории фестиваля будет работать палаточный городок двух уровней. Для всех посетителей предусмотрена возможность многоразового входа.</p>\r\n<p>Главные анонсы и имена еще впереди!<br /><br />*Фестиваль ATLAS WEEKEND был основан в Украине в 2015 году. Его организатором выступает ночной клуб ATLAS, в честь которого фестиваль и получил свое название. Основная цель ATLAS WEEKEND &ndash; развитие фестивальной культуры в стране, а также привлечение иностранных туристов в Украину и мировая популяризации украинской музыки.&nbsp;<br /><br />ATLAS WEEKEND&nbsp;- главное музыкальное событие в жизни&nbsp;страны!<br /><br />VIP &ndash; билет на фестиваль включает в себя:&nbsp;<br /><br />- Отдельный VIP-вход на фестиваль&nbsp;<br />- Место на парковке&nbsp;<br />- Место за столиком в VIP-зоне&nbsp;<br />(столики расположены на возвышении сбоку от сцены и обладают отличным обзором)&nbsp;<br />- VIP-бар с обслуживанием столиков</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'atlas_weekend', 1467993600, '19:00', 600, 3000, '', 'dead0a60d68db7016578a26ad0aaf98e.jpg', 1, 1, 76, 5, 0, 1450699310, 1451041731, ''),
	(103, 2, NULL, NULL, 'ДРУГА РІКА', '', '', '', 'druga_rika', 1457110800, '19:00', NULL, NULL, '', '76e4e79e4347cbfac90bc76a5d0079a7.jpg', 1, 1, 299, 6, 0, 1451118760, 1451310250, NULL),
	(104, NULL, 1, 'Областной Дворец Культуры', 'Поезд «Одесса-мама»', '', '', '<div class="text">\r\n<p>Поезд &laquo;Одесса-мама&raquo;</p>\r\n<p>Железнодорожное приключение Русланы Писанки и Олега Филимонова</p>\r\n<p>Сегодня юмористический жанр несколько дискредитирован, поэтому зрителю всегда приятно, когда ему напоминают, что такое хорошая комедия. Спектакль &laquo;Поезд &laquo;Одесса-мама&raquo; &mdash; как раз такая постановка, в которой театральные эксперименты авторов органично сливаются с точной работой режиссера Игоря Славинского и блестящей актерской игрой Русланы Писанки, Олега Филимонова, Виктора Андриенко, Якова Гоппа.</p>\r\n<p>Игорь Славинский</p>\r\n</div>\r\n<div class="hidden-text">\r\n<p>&mdash; Наша задача &mdash; сделать в целом смешной, иногда трогательный, а местами и трагичный спектакль об общечеловеческих ценностях. Продюсеры (они же авторы пьесы) Александр Тарасуль, Евгений Хаит и Виктор Явник сумели собрать звездный состав, а это нелегко, ведь актеры живут в разных городах и у каждого довольно плотный график. Для меня мотивацией стала, прежде всего, любовь к Одессе. И, конечно же, интересный материал.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Руслана Писанка</p>\r\n<p>&mdash; Репетировать спектакль, который тебе не интересен, все равно, что спать с мужчиной, который тебя не привлекает. Этот &laquo;мужчина&raquo; меня привлекает. Пьеса задела меня, я увидела много интересного и даже непонятного в образе героини, поэтому и согласилась. Сейчас собираю этот образ: наблюдаю, что-то одалживаю у знакомых, а что-то достаю из своего нутра.</p>\r\n<p>Что будет, если в купе не хватит места для характеров наших персонажей? Попрошу Олега выйти. И тогда будет достаточно места для меня одной. Ну вот, во мне уже говорит моя героиня. (<em>Смеется</em>.) Именно об этом и будет наш спектакль &mdash; как два характера уживаются в замкнутом пространстве.</p>\r\n<p>Олег Филимонов</p>\r\n<p>&mdash; Мой герой &mdash; закомплексованный пятидесятилетний мужчина, за которого всё решает мама. С одной стороны, может, и хорошо, что человек не знает проблем, с другой стороны, для нормального мужчины такая жизнь аномальна. В конце истории мой герой вырастает, предпринимает решительные действия, совершает поступки достойные настоящего мужчины &mdash; и всё это требует сложной актерской игры. Помогает работа с Русланой Писанкой. Она очень профессиональная актриса и не боится выглядеть смешной. Это сразу &laquo;цепляет&raquo; зрителя. Поначалу между ее Наталкой и моим Мишей сильный контраст, но в пути с ним происходят большие перемены. У него всё в первый раз: первый раз без мамы, первый раз общение с женщиной, даже самогонку пьет первый раз.</p>\r\n<p>Яков Гопп</p>\r\n<p>&mdash; В спектакле &laquo;Поезд &laquo;Одесса-мама&raquo; я играю проводника &mdash; роль небольшая, но из нее можно сделать конфетку. После съемок в таких кино- и телефильмах, как &laquo;Мишка-Япончик&raquo;, &laquo;Шулер&raquo;, &laquo;Улыбка Бога&raquo;, где у меня были скорее драматические роли, я отвык от комедийного амплуа. Тем более приятно вернуться к нему на театральной сцене.</p>\r\n<p>Виктор Андриенко</p>\r\n<p>&mdash; Все говорят про знаменитый одесский юмор, а я считаю, что это дух Одессы. Одесситы просто так говорят, а другие думают, что они так шутят. Поэтому наш спектакль с одесским колоритом сегодня всем необходим: люди устали от того, что происходит в жизни, они нуждаются в обычных человеческих ценностях. Это безудержное веселье и гомерический смех, всеохватная грусть и непрошеные слезы. Ради участия в спектакле я отложил все дела!</p>\r\n</div>', 'poezd_odessa-mama', 1457888400, '19:00', 120, 350, '', '3b3f4f22f4fe6af0b45a8eabdbbdf4a8.jpg', 1, 1, 271, 8, 0, 1451127918, 1451902439, 'https://arm.frontmanager.com.ua/PublicAPI/Tickets.aspx?__uid=XyGK3S44IpEmOTtrFGR44A&event=457732426'),
	(105, NULL, 1, 'Юность', 'АнтителА', '', '', '', 'antitela', 1459526400, '19:00', 99, 220, '', '699c781f7f8bdc7e3708af3415321cf0.jpg', 1, 1, 111, 9, 0, 1451128423, 1451323052, 'https://arm.frontmanager.com.ua/PublicAPI/Tickets.aspx?__uid=XyGK3S44IpEmOTtrFGR44A&event=454471993'),
	(106, NULL, 10, 'Дворец Спорта', 'The Prodigy', '', '', '<p>The Prodigy<br /><br />12 апреля 2016 19:00 в киевском Дворце спорта<br /><br />Самые бесшабашные воины рейва в полной боеготовности!<br /><br />Двадцать лет назад The Prodigy нечаянно и негаданно сумели лучше всех выразить в звуке лихой, яростный, оголтелый и свободный дух 90-х &ndash; хотя, конечно, Лайм Хаулетт и его гиперактивные друзья, собирая свою злую и дикую музыку на синтезаторах, сэмплерах и секвенсорах, ни о чем таком даже близко не задумывались. И, тем не менее, зубастый звук The Prodigy, равно,&nbsp; как и их &laquo;насекомый&raquo; логотип и оскаленно-безумный образ настолько крепко ассоциируются с балахонами, школьными дискотеками и первыми измененными состояниями сознания, что как-то и забывается тот факт, что вообще-то The Prodigy были ценны не только своим панковским имиджем и бунтарской эстетикой.<br /><br />По-хорошему говоря, это одна из самых изобретательных, смекалистых и новаторских групп последней четверти века, люди, сумевшие вывести британский танцевальный андеграунд на большую сцену и заставить всех двигаться под свой остервенелый ритм. Неслучайно критики из кожи вон лезли, стараясь придумать для песен The Prodigy новый термин, который совместил бы в себе слова &laquo;рок&raquo; и &laquo;рейв&raquo;: животный драйв первого Хаулетт, Кейт Флинт и Максим сумели свести с неумолимой энергетикой второго, причем сделали это максимально находчиво. В их лучших вещах всегда хватало не только сокрушительного запала, но и кропотливого музыкального остроумия. Никто и никогда до них не говорил заветные слова &laquo;мы хотим танцевать&raquo; настолько громко и настолько убедительно.<br /><br />Все это актуально и сейчас.<br /><br />Весной 2015-го группа выпустила свой новый альбом с красноречивым названием &laquo;The Day Is My Enemy&raquo;, и заголовок этот &ndash; не пустое бахвальство: из пластинки бьет такая энергия, что сердце, в буквальном смысле, колотит в большой барабан, а все остальные органы чувств спешно надевают амуницию. За прошедшее с 90-х время стало окончательно понятно, что The Prodigy &ndash; вовсе не однодневки, а по-настоящему большие и влиятельные музыканты (спросите хоть Noize MC, хоть группу Die Antwoord). Их живые выступления максимально далеки от почивания на лаврах: это ультимативная вечеринка, пир духа в самом раблезианском смысле этого слова. Лайам Хаулетт заводит свою машинерию, Кейт Флинт делает большие глаза, Максим кричит в микрофон: &laquo;Ну как вы, мои воины?&raquo;.<br /><br />А дальше &ndash; сами знаете: мэджик пипл, вуду пипл, и музыка, которая по-лютому прет&hellip;</p>', 'the_prodigy', 1460476800, '19:00', 590, 2990, '', '8fb0446559e3d4b830d5554876d99bd4.jpg', 1, 1, 122, 2, 0, 1451135805, 1452252458, 'https://arm.frontmanager.com.ua/PublicApi/Tickets.aspx?__uid=ymHTO0sB02RN1XaBFqRcuA&event=499016365'),
	(107, 1, NULL, NULL, 'ТEULIS', 'Театр теней «Teulis»', 'Володарі Тіней', '<p>Живое воплощение человеческих чувств с помощью языка жестов и символизма силуэтов способно передать больше эмоций и смысла, чем художественный фильм. Все зависит от харизматичности актеров и качества режиссёрской работы.&nbsp;</p>\r\n<p>Невероятно динамичная программа и профессионализм мастеров &laquo;Teulis&raquo; привели николаевского зрителя к тем поклонникам, которые рукоплещут стоя выдающимся артистам театра теней.</p>\r\n<p>Как известно, &laquo;Teulis&raquo; стали финалистами крупнейших талант шоу в Италии, Турции, России, Чехии и Словакии, гастролировали в Финляндии, Швеции, Польши, Чехии, Турции. Недавно театр вернулся из Японии, где 35 000 зрителей стоя провожали артистов.</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><iframe src="https://www.youtube.com/embed/0ZR5i73g9k4" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', 'teulis', 1457542800, '19:00', NULL, NULL, '', '11bdec146176c5d05a097717f121b191.jpg', 1, 1, 363, 3, 0, 1451312743, 1451318705, NULL),
	(108, NULL, 1, 'Областной Дворец Культуры', 'НЕАНГЕЛЫ', '', '', '', 'neangely', 1460476800, '19:00', 150, 550, '', '2d5eb91b78daf2ad51a3930f28faad97.jpg', 1, 1, 414, 4, 0, 1451314524, 1451319371, 'https://arm.frontmanager.com.ua/PublicAPI/Tickets.aspx?__uid=XyGK3S44IpEmOTtrFGR44A&event=498183868'),
	(109, 3, NULL, NULL, 'Теулис Херсон 7 марта', 'Театр теней Teulis', 'Володарі Тіней', '', 'teulis_herson_7_marta', 1457370000, '19:00', NULL, NULL, '', NULL, 1, 0, NULL, 0, 0, 1451316279, 1452001691, NULL),
