INSERT IGNORE INTO `content` (`id`, `name`, `alias`, `title`, `description`, `keywords`, `text`, `status`, `created_at`, `h1`, `updated_at`, `sort`, `parent_id`, `class`, `views`) VALUES
	(2, 'Контакты', 'kontakty', 'ОДК центральная концертная касса - тел.500-505 Николаев', ' Центральная концертная касса Николаева.Лучший выбор билетов на самые значимые мероприятия Николаева,онлайн продажа,бронирование и доставка билетов. Мы находимся в Обл Дк (ОДК) пл.Судостроителей, 3 тел.(0512) 500-505, 36-22-64. Так же продажа билетов на мероприятия по всей Украине\r\n', ' тел 500-505 36-22-64  центральная театральная концертная касса Николаев обл ДК  касса ОДК Николаевский Областной Дворец Культуры концерт Холл Юность\r\n', '<h4 style="text-align: center;">находится по адресу пл.Судостроителей 3 (Областной Дворец Культуры)</h4>\r\n<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d1361.4373303559946!2d31.9872751!3d46.9641526!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0000000000000000%3A0x8778b0e81712c33d!2z0KbQtdC90YLRgNCw0LvRjNC90LDRjyDRgtC10LDRgtGA0LDQu9GM0L3Qvi3QutC-0L3RhtC10YDRgtC90LDRjyDQutCw0YHRgdCw!5e0!3m2!1sru!2sua!4v1440273335581" width="550" height="412" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<h5 style="text-align: center;">Время работы кассы:</h5>\r\n<h5 style="text-align: center;">понедельник-пятница с 11-00 до 19-00</h5>\r\n<h5 style="text-align: center;">суббота с 12-00 до 16-00</h5>\r\n<h5 style="text-align: center;">воскресенье - выходной</h5>\r\n<p style="text-align: center;">&nbsp; телефон (0512)&nbsp;<strong>500-505</strong></p>\r\n<p style="text-align: center;"><strong><img src="http://hochu-bilet.com/Media/files/filemanager/IMG_3927.JPG" alt="" width="669" height="260" /></strong></p>\r\n<p style="text-align: center;">&nbsp;</p>', 1, 1421594834, 'Центральная театрально-концертная касса', 1450527496, 3, 0, NULL, 1450),
	(7, 'Вопрос-Ответ', 'vopros-otvet', 'вопросы и ответы на них от сайта Хочу Билет в Николаеве', 'Часто задаваемые вопросы клиентов концертного агентства Маэстро и сайта Хочу билет', 'вопросы ответы популярные Маэстро Николаев концертное агентство Тина Кароль Николаев заказать билеты на концерт доставка билетов касса ОДК', '<p><strong>1. Как узнать цену билетов,&nbsp;уточнить есть ли они в наличии и забронировать ?&nbsp;</strong></p>\r\n<p>На страничке&nbsp;<a href="http://hochu-bilet.com/afisha" target="_blank">Афиша</a>&nbsp;&nbsp;выберите интересующее Вас мероприятие&nbsp;и нажмите кнопку: <span style="color: #008000;"><strong>&laquo;Хочу билет&raquo;</strong></span>. Вы увидите схему, на которой можно &nbsp;выбрать конкретное место и забронировать его (цвет обозначает ценовую категорию, которая указана вверху схемы) :</p>\r\n<p><br /> &bull; Места серого цвета &ndash; выкуплены либо же их нет в продаже:</p>\r\n<p>&bull; Места красного цвета уже кем-то забронированы</p>\r\n<p>&bull; Места других цветов &ndash; свободные.</p>\r\n<p>&nbsp;<strong>2. Как оформить заказ билетов?</strong></p>\r\n<p>Кликните мышкой на свободное место либо несколько мест.</p>\r\n<p>Под &nbsp;схемой вы увидите свой заказ, &nbsp;нажимайте <strong><span style="color: #ff0000;">&laquo;Купить&raquo;</span>.</strong> Заполните детально <strong>&laquo;Форму заказа&raquo;</strong> (указывайте реальные данные). Далее у Вас есть два варианта:</p>\r\n<p>1) если вы хотите забронировать выбранные билеты нажмите <span style="color: #008000;"><strong>&laquo;Заказать&raquo;</strong></span>. В данном случае Ваши билеты будут Забронированы и в течении трех дней, Вы можете их выкупить в&nbsp;<a href="http://hochu-bilet.com/kontakty" target="_blank"> нашей кассе</a>&nbsp;по адресу пл. Судостроителей,3 (ОДК). Тел.: (0512) 500-505</p>\r\n<p>2) <strong>если хотите Купить</strong> нажмите <strong><span style="color: #008000;">&laquo;Оплатить&raquo;</span>.</strong> Далее Вы оплачиваете удобным для Вас способом и после успешной оплаты</p>\r\n<p><strong><span style="background-color: #ff6600;">&nbsp; <span style="color: #ffffff;">&nbsp;!ВАЖНО!</span> &nbsp;&nbsp;</span></strong> Вы&nbsp;можете забрать свой оплаченный &nbsp;билет <span style="color: #ff0000;"><strong><em>&nbsp;</em><span style="color: #ff6600;">ТОЛЬКО</span></strong></span> у нас на кассе (<a href="http://hochu-bilet.com/kontakty" target="_blank">режим работы</a>)&nbsp;в любое удобное для Вас время. Желательно до начала мероприятия:))&nbsp;</p>\r\n<p>После оформления заказа, на указанный вами e-mail прийдет письмо с данными Вашего заказа.</p>\r\n<p><strong>3. Как получить билет на кассе?</strong></p>\r\n<p>Для получения забронированного или оплаченного билета Вам необходимо сказать на кассе номер заказа (приходит к Вам на почту) свою фамилию либо номер телефона. Именно поэтому ВАЖНО указывать свои реальные данные в заказе.</p>\r\n<p><strong>4. Лениво&nbsp;ехать за билетом, че делать?</strong></p>\r\n<p>Нет ничего сложного:) Мы доставим билет по нужному адресу. Для этого нужно забронировать билет и <a href="http://hochu-bilet.com/maildirector" target="_blank">заполнить</a>&nbsp;форму заявки на доставку.</p>\r\n<p><strong>5. Как оплатить билет?&nbsp;</strong></p>\r\n<p>Есть несколько способов. Выбирайте наиболее комфортный&nbsp; для себя:<br /> &bull; платежной картой любого банка&nbsp;</p>\r\n<p>&bull; через платежные терминалы самообслуживания&nbsp; ПриватБанк</p>\r\n<p>&bull; наличными в&nbsp;<a href="http://hochu-bilet.com/kontakty" target="_blank">центральной театрально-концертной кассе</a></p>\r\n<p><strong>6. Что делать, если концерт отменили?</strong></p>\r\n<p>В случае отмены мероприятия Вам необходимо сдать билет в той кассе, в которой вы его приобретали.</p>\r\n<p><strong>7. Могу ли я вернуть билет в случае изменения личных планов?</strong></p>\r\n<p>Билеты подлежат возврату только в случае отмены мероприятия, на которое были куплены.</p>\r\n<p><strong>8. Сервисный сбор</strong></p>\r\n<p>Сервисный сбор &ndash; это плата за услуги финансовых учреждений по приему и обработке платежа. Размер варьируется в зависимости от события и выбранного способа оплаты.</p>\r\n<p><strong>9. Я забронировал билет, сколько у меня есть времени?</strong></p>\r\n<p>Забронированные билеты Вы можете выкупить <span style="color: #ff0000;"><strong>в течении 3-х дней</strong></span> с момента бронировки.</p>\r\n<p>ВНИМАНИЕ!!! Услуга бронирования билетов закрывается за 2 дня до мероприятия.</p>\r\n<p><strong>10. Есть ли у вас скидки &nbsp;на билеты?</strong></p>\r\n<p>Есть. Подробнее можно посмотреть во вкладке&nbsp;<a href="http://hochu-bilet.com/akcija" target="_blank">Акция</a></p>', 1, 1421739016, 'Вопрос-Ответ', 1450527074, 1, 0, 'garanty', 947),
	(13, 'О нас', 'o_nas', 'О нас:  информация о концертном агентстве Маэстро организация концертов в Николаеве и Херсоне', 'организация концертов в Николаеве и Херсоне Полная информация о деятельности концертного агентства Маэстро, в частности проекта Хочу Билет в Николаеве.', 'о нас концертное агентство Маэстро организация концертов в Николаеве и Херсоне сайт Хочу билет и касса ОДК', '<p>Концертное агентство &laquo;МАЭСТРО&raquo; уже более 15 лет занимается организацией концертов, спектаклей, спортивных мероприятий, фестивалей, корпоративных праздников, рекламных акций, детских и других мероприятий.</p>\r\n<p>Нами было проведено более 300&nbsp;концертов, спектаклей и мероприятий самого разного масштаба &ndash; от корпоративов до крупных Фестивалей!</p>\r\n<p>Если вы хотите организовать корпоративный праздник, рекламную акцию, &nbsp;или любое другое мероприятие, мы &nbsp;предложим Вам&nbsp; самые хорошие условия.</p>\r\n<p>Мы придумаем для Вас интересные идеи и освободим Вас от необходимости тратить время и нервы на их реализацию. Мы поможем Вам оформить аренду загородных площадок, автотранспорта, отелей, ресторанов, необходимого звуко-технического оборудования, сценических конструкций&hellip;окажем помощь в бронировании авиа и ж/д билетов для ваших гостей, возьмем на себя изготовление печатной продукции, пригласительных, программ фестивалей, рекламных буклетов и пр.</p>\r\n<p>Над каждым нашим мероприятием работает команда специалистов, в которую входят профессиональные координаторы, сценаристы, декораторы, фотографы, видео-операторы и ведущие. Именно поэтому нам доверяют проведение самых важных мероприятий.</p>\r\n<p>Все рутинное, связанное с организационными вопросами, мы полностью берем на себя! Все пожелания клиента нами всегда учитываются и воплощаются в жизнь!</p>\r\n<p>И главное: мы&nbsp; вкладываем душу в нашу работу. Вы останетесь довольны:)</p>\r\n<p>&nbsp;</p>', 1, 1421740458, ' Организация концертов в Николаеве и Херсоне', 1450527135, 2, 0, NULL, 540),
	(14, 'Акция', 'akcija', 'Акция Хочу билет на концерты в Николаеве ', '', 'Акция Хочу билет скидка на билеты в ОДК Николаев', '<p style="text-align: center;">&nbsp;<span style="color: #ff0000;"><strong>*********************************************************************************************************************************************************</strong></span></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://hochu-bilet.com/Media/files/filemanager/dr.png" alt="" width="186" height="144" /></p>\r\n<p style="text-align: center;"><strong>Внимание!</strong> Всем именинникам на любое мероприятие &nbsp;концертное агентство "Маэстро" дарит&nbsp;<span style="color: #ff0000;"><strong>скидку10%.</strong></span></p>\r\n<p style="text-align: left;">Для получения скидки: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp;-Ваш День рождения должен совпадать с датой проведения мероприятия. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<p>&nbsp;-При покупке билета Вы должны показать паспорт кассиру.</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;"><strong>*****************************************************************************************************************************************************</strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong><span style="color: #0000ff;">Будь с нами!</span></strong></span></p>\r\n<p style="text-align: center;"><a href="https://vk.com/centralkassahochubilet" target="_blank"><img src="http://hochu-bilet.com/Media/files/filemanager/4C7wwrtuF74.jpg" alt="4C7wwrtuF74" width="182" height="46" /></a>&nbsp;</p>\r\n<p style="text-align: center;">Разыгрываются&nbsp;ДВА билета на концерт группы"Resonanсe" который состоится в Николаеве 9 февраля 2016 г. в 19:00, в Областном Дворце Культуры и ДВА билета на мюзикл " Notre Dame de PARIS" который Вы увидите 10 февраля в 19-00 в ОДК<br />Розыгрыш будет проводится только среди подписчиков группы:&nbsp;<a href="http://vk.com/centralkassahochubilet" target="_blank">http://vk.com/centralkassahochubilet</a>&nbsp;и будет проведен методом случайного выбора.<br /><br />Для участия в розыгрыше Вам необходимо:<br />1. Вступить в группу<br />2. Поставить ЛАЙК и сделать РЕПОСТ&nbsp;<a href="https://vk.com/centralkassahochubilet?w=wall-99806515_1038" target="_blank">данного сообщения</a>.</p>\r\n<p style="text-align: center;">5 февраля 2016 г. в 18:00 рандомно будет определено 2 победителя!</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;</strong></span></p>', 1, 1438805643, 'Акция', 1452024396, 0, 0, NULL, 1092);
INSERT IGNORE INTO `control` (`id`, `name`, `h1`, `title`, `keywords`, `description`, `text`, `alias`, `status`, `created_at`, `updated_at`) VALUES
	(1, 'Главная страница', 'Хочу Билет | Центральная касса Николаева |  Афиша  |  Онлайн продажа и заказ билетов', 'Афиша Николаева  Билеты на Концерты и спектакли в Николаеве касса ОДК Хочу Билет доставка билетов', ' концертное агентство Маэстро концерт Николаев Хочу Билет спектакль  концертная касса Афиша Николаева касса ОДК билеты онлайн мероприятия в николаеве билеты на концерты в Николаеве Тина Кароль Квартал 95 Лепс Ирина Билык Ани Лорак Олег Винник Лобода Наталья Могилевская Океан Эльзы Театр Теней Вакарчук Антипенко Арнтгольц  Двое на качелях Нотр дам де Париж', ' Сайт центральной театрально-концертной кассы онлайн продажа,заказ и доставка билетов. сайт Хочу Билет - лучший выбор билетов на концерты в ОДК и концерт холле "Юность" Николаев тел (0512) 500-505', '<p style="text-align: center;"><span style="color: #008000;"><strong>На сайте Хочу билет Вы можете забронировать билеты , купить билеты онлайн , заказать доставку билетов. Есть возможность приобретения билетов по безналу.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>с 2015 г. "Центральная театрально-концертная касса" стала частью компаний билетных операторов. Cодержит большую базу мероприятий, проходящих в Одессе,Киеве и других городах на территории Украины и анонсов событий, включая эксклюзивные события, такие как гастроли мировых звезд, поп- и рок-групп.</p>\r\n<p><strong>В нашей кассе Вы всегда можете купить билеты в Одесский Оперный Театр и Одесский дельфинарий. Подробнее по тел. (0512) 500-505</strong></p>\r\n<p><strong>&nbsp;</strong><img style="display: block; margin-left: auto; margin-right: auto;" src="http://ho4ubilet.vps.kherson.ua/Media/files/filemanager/Kassa%209X5h.jpg" alt="Kassa 9X5h" width="682" height="249" /></p>\r\n<p><span style="color: #000000;">Мы предоставляем организаторам мероприятий &nbsp;обслуживание по&nbsp;продаже билетов и организации рекламной кампании планируемых мероприятий. Анонс и поддержка&nbsp;мероприятия в социальных сетях, работа с безнальными клиентами, выполнение бытового и тех.райдера</span></p>\r\n<p style="text-align: center;"><span style="color: #000000;">Гарантия качественного выполнения работ</span></p>', 'index', NULL, NULL, 1451296521),
	(2, 'Контакты', 'Контакты', ' касса ОДК Контакты афиша Николаева хочу билет', 'Контакты центральная касса ОДК (0512) 50-05-05 Афиша Концерт Холл Юность Николаев Тина Кароль Квартал 95 Олег Винник Ани Лорак Наталья Могилевская Лобода Театр Теней Двое на Качелях Татьяна Арнтгольц и Григорий Антипенко Резонанс Нотр дам де Париж Скорпионс в Одессе Океан Эльзы Вакарчук', 'Центральная концертная касса Николаева- лучший выбор билетов на мероприятия в ОДК и концерт холле "Юность"Николаев. Справки,бронирование и доставка билетов по тел. (0512) 500-505 и на сайте Хочу билет. ком адрес кассы пл.Судостроителей, 3', '', 'contact', NULL, NULL, 1450625160),
	(3, 'Бронирование билетов', 'онлайн заказ билетов на концерты в николаеве', 'Центральная касса ОДК  это возможность купить билет на концерт в Николаеве: онлайн бронирование и продажа  билетов на концерты', ' купить билеты заказать забронировать заказ доставка билетов Николаев концерты спектакли телефон онлайн 500-505 афиша николаева\r\n', 'Центральная театрально-концертная касса Хочу Билет Николаев - онлайн продажа,заказ, бронирование билетов  по тел (0512) 500-505 Николаевский областной дворец культуры (ОДК)', '<h1><strong>Билеты на концерты</strong></h1>\r\n<p><strong>Забронировать билеты</strong>&nbsp;:</p>\r\n<p>&nbsp;Необходимо заполнить <strong>Форму бронирования билетов</strong> внизу этой страницы и нажать <span style="color: #008000;"><strong>Бронировать</strong></span>, с Вами в первую очередь свяжется наш кассир&nbsp;и поможет&nbsp;выбрать лучшие места в зале, согласно Вашим пожеланиям.</p>\r\n<p>В заявке необходимо указать Ваши ФИО, номер мобильного телефона, количество билетов и приемлемую для Вас цену или же желаемые места</p>\r\n<p>&nbsp;Так же Вы можете забронировать билеты, позвонив по телефону (0512) <strong>500-505</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em><strong>Бронирование билетов</strong> </em>- <em><span style="color: #339966;"><strong>бесплатная услуга</strong> </span><strong>!</strong></em></p>\r\n<p>Время работы "Центральной театрально-концертной кассы":</p>\r\n<ul>\r\n<li>понедельник-пятница с 11-00 до 19-00</li>\r\n<li>суббота с 12-00 до 16-00</li>\r\n<li>воскресенье - выходной</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'book_tickets', NULL, NULL, 1450528110),
	(4, 'Рассылка', 'Рассылка', 'Рассылка о обновлениях в концертной программе', 'рассылка концерты обновления программа Николаев Украина', 'Подпишитесь на рассылку и будьте всегда в курсе о будущих концертах в Николаеве и других городах Украины.', '<h1>Рассылка</h1>\r\n<p>Чтобы узнать <strong>первым</strong> о будущих концертах в&nbsp;Николаеве , Вы можете заполнить форму на этой странице.</p>\r\n<p>Как только в закладке&nbsp;<strong>Афиша</strong>&nbsp;появятся новые мероприятия, мы разошлем эту информацию всем подписчикам.</p>\r\n<p style="text-align: center;">&nbsp;</p>', 'delivery', NULL, NULL, 1449926321),
	(5, 'Доставка билетов', 'Письмо админу', 'Доставка билетов на концерты Хочу билет', 'доставка билетов концертное агентство маэстро Хочу Билет справки и заказ билетов по тел. (0512) 500-505 бронирование и доставка билетов', 'Хочу Билет заказ, бронирование и доставка билетов на концерты ', '<h4>Вы можете заказать доставку билетов по городу Николаеву.</h4>\r\n<h5>Стоимость доставки курьером по городу <strong>40грн</strong></h5>\r\n<p>Для того чтобы заказать доставку билетов Вам необходимо:</p>\r\n<p>1. Забронировать билеты у нас на сайте.</p>\r\n<p>2. Заполнить форму заказа доставки.</p>\r\n<h5><strong><span style="color: #ff6600;">ВАЖНО!!!</span> </strong>Обязательно укажите номер заказа&nbsp;(приходит на Ваш e-mail, указанный при заказе), адресс доставки и Ваш контактный телефон.</h5>\r\n<p>*Доставка осуществляется в течении 1-3-х дней по предварительной договоренности.</p>\r\n<p>&nbsp;В другие города Украины доставка осуществляется "Новой почтой" и возможна только для оплаченных билетов.&nbsp;Стоимость данной доставки согласно тарифов "Новой почты".</p>\r\n<p><span style="color: #008000;">Если у Вас &nbsp;возникли вопросы: (0512) 500-505 (звоните в рабочее время)</span></p>', 'maildirector', NULL, NULL, 1450527653),
	(6, 'После оплаты', 'После оплаты', 'После оплаты', 'После оплаты', 'После оплаты', '<p><strong>Благодарим за покупку!</strong></p>', 'after_payment', 0, NULL, 1439275607);
