INSERT IGNORE INTO `mail_templates` (`id`, `name`, `subject`, `text`, `updated_at`, `status`) VALUES
	(1, 'Контактная форма ( Директору )', 'Новое сообщение из формы "Письмо директору" - сайт {{site}}', '<p>Вам пришло новое письмо из формы "Письмо директору" с сайта {{site}}!</p>\r\n<p>Имя отправителя: {{name}} ( {{ip}} ).</p>\r\n<p>E-Mail отправителя: {{email}}.</p>\r\n<p>IP отправителя: {{ip}}.</p>\r\n<p>Дата сообщения: {{date}}.</p>\r\n<p>Текст сообщения: {{text}}.</p>\r\n<p>&nbsp;</p>\r\n<p>Письмо сгенерировано автоматически. Пожалуйста не отвечайте на него!</p>', 1426080449, 1),
	(2, 'Письмо после подписки ( Пользователю )', 'Спасибо за подписку! Сайт {{site}}', '<p>Спасибо за подписку на новости и акции на сайте {{site}}.</p>\r\n<p>&nbsp;</p>\r\n<h5><span style="color: #999999;">Для того, что бы отписаться, перейдите по ссылке {{link}}.</span></h5>\r\n<h5><span style="color: #999999;">Письмо создано автоматически. Пожалуйста не отвечайте на него.</span></h5>', 1441312985, 1),
	(3, 'Заказ звонка ( Администратору )', 'Заказ звонка', '&lt;p&gt;Новый заказ звонка!&lt;/p&gt;\r\n&lt;p&gt;Зовут: {{name}}.&lt;/p&gt;\r\n&lt;p&gt;Номер телефона: {{phone}}.&lt;/p&gt;', 1423057992, 1),
	(11, 'Новый заказ ( Администратору )', 'Новый заказ', '<p>Новый заказ #{{order_number}}:</p>\r\n<p>Название мероприятия:&nbsp;<strong>{{event_name}}</strong></p>\r\n<p>{{data}}</p>\r\n<p>Для уточнения деталей перейдите по ссылке:</p>\r\n<p>{{link_admin}}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1449048385, 1),
	(12, 'Новый заказ ( Пользователю )', 'Новый заказ', '<h3><strong>Благодарим за ваш заказ:)</strong></h3>\r\n<h2><strong>Ваш заказ:</strong>&nbsp;<span style="color: #ff0000;">№ <strong>{{order_number}}</strong></span></h2>\r\n<p><span style="color: #000000;">Название мероприятия:&nbsp;<strong>{{event_name}}</strong></span></p>\r\n<p>{{data}}</p>\r\n<p>Оплатить можно по ссылке: {{link_user}}</p>\r\n<p><span style="color: #ff0000;"><strong>Внимание!!!</strong>&nbsp;</span>Бронь на зарезервированные Вами билеты действительна в течении&nbsp;<strong>72-х часов</strong> с момента заказа. Если в течении 72-х часов вы не выкупили свои билеты - Ваш резерв будет аннулирован.</p>\r\n<p><span style="color: #008000;"><strong>Забрать свои билеты&nbsp;вы можете в Центральной театрально-концертной кассе&nbsp;по адресу: пл. Судостроителей,3 (Областной Дворец Культуры), тел.: (0512) 50-05-05</strong></span></p>', 1449053567, 1),
	(13, 'Бронирование билетов', 'Бронирование билетов', '<p>бронирование билетов</p>\r\n<p>Пользователь:&nbsp;<strong>{{name}}</strong></p>\r\n<p>Заказал бронь на&nbsp;<strong>{{event_name}}</strong></p>\r\n<p>Сообщение:&nbsp;<strong>{{text}}</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Контакты пользователя</p>\r\n<p>Имя:&nbsp;<em>{{name}}</em></p>\r\n<p>E-mail:&nbsp;<em>{{email}}</em></p>\r\n<p>Телефон:&nbsp;<em>{{phone}}</em></p>\r\n<p>&nbsp;</p>', 1426085092, 1);
