	(10, 1442601725, NULL, 'Rock symphony', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://hochu-bilet.com/Media/files/filemanager/d4eed9cb04a5c808b8b92a0cf0fbb708.jpg" alt="d4eed9cb04a5c808b8b92a0cf0fbb708" /></p>\r\n<p>"Рок Симфония" звучит очень целостно, треки незаметно меняются один на другой, формируя единое монолитное&nbsp;произведение.<br />Слияние виртуозных инструментов хора и оркестра создает непередаваемые ощущения.<br />Эмоции на концерте меняются от бурного восторга до тихого лирического наслаждения мелодичными звуками.<br />Впечатления от каждой следующей композиции наслаиваются на впечатление от предыдущих, и в самом конце звучит стремительный, динамичный, виртуозно финал, подрывая эмоции и доставляя истинным ценителям эмоциональной музыки непередаваемое удовольствие!</p>\r\n<p>&nbsp;</p>', 'maestro-san@mail.ru;elina.vedara@mail.ru', 2),
