	(30, 1443534758, NULL, 'ALEXEI', '<div style="text-align: center;"><strong><img src="http://hochu-bilet.com/Media/files/filemanager/fed4fa139e84f7bc4e0180bd10cc7994.jpg" alt="fed4fa139e84f7bc4e0180bd10cc7994" /></strong></div>\r\n<div style="text-align: center;"><strong>HYMNE A L&rsquo;AMOUR</strong></div>\r\n<div style="text-align: center;">\r\n<div>О ЛЮБВИ И СТРАСТИ</div>\r\n<div>НА СЕМИ ЯЗЫКАХ МИРА</div>\r\n</div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div style="text-align: center;">\r\n<div><strong><span style="color: #ff0000;">ПРОГРАММА</span></strong></div>\r\n<div><strong>Программа концерта HYMNE A L&rsquo;AMOUR &ndash; &laquo;ГИМН ЛЮБВИ&raquo; состоит из 25 сильнейших композиций:</strong>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Французские хиты от нестареющих&nbsp;</strong></div>\r\n<div>L\'hymne а l\'amour Эдит Пиаф и La Boheme Шарля Азнавура,</div>\r\n<div><strong>до лучших образцов поп-рока,</strong></div>\r\n<div>Diego libre dans sa t&ecirc;te, Vivre pour le meilleur, Pardon</div>\r\n<div>и Le bien qui fait mal из рок-оперы MOZART.&nbsp;</div>\r\n<div><strong>Классический кроссовер:</strong>&nbsp;</div>\r\n<div>Alejate, L\'Ultima Notte, All\'improvviso amore, Una Parte Di Me.&nbsp;</div>\r\n<div><strong>Танцевальные</strong></div>\r\n<div>Volare, Quizas, Quizas, Quizas, Surrender (Torna a Surriento).</div>\r\n<div><strong>Ставшие почти классикой</strong></div>\r\n<div>Adagio, Can\'t Help Falling in Love Элвиса Пресли,</div>\r\n<div>Parla pi&ugrave; piano, впервые прозвучавшая в фильме</div>\r\n<div>&laquo;Крестный отец&raquo;, баллада Hijo De La Luna, фактически стандарт популярной музыки Mi fa morire cantando,</div>\r\n<div>вариация на знаменитую &nbsp;неаполитанскую песню</div>\r\n<div>Funicul&igrave; Funicul&agrave; - Home To Mamma,</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp;O Fortuna, открывающая кантату Carmina Burana</div>\r\n<div>Карла Орфа, легендарная&nbsp;<strong>Caruso&hellip;</strong></div>\r\n<div><strong>...и множество приятных сюрпризов!</strong></div>\r\n</div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div style="text-align: center;"><strong>Сочетание оркестра, хора, рок-бенда, невероятной красоты сцена, яркая красивая эмоционально мощная программа, все вместе создаст незабываемые ощущения и подарит зрителям сильнейший заряд радости и удовольствия.</strong></div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div style="text-align: center;">\r\n<div>&nbsp;</div>\r\n<div><strong>АLEXEI</strong></div>\r\n</div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div>\r\n<div style="text-align: center;"><strong>Ему покровительствуют западные продюсеры, пророчащие мировое признание и, благодаря творчеству Алексея, появление Украины на культурной карте мира. Над его имиджем работают известные стилисты, художники и режиссеры.</strong></div>\r\n<div>&nbsp;</div>\r\n<div>Первое знакомство украинцев с Алексеем Кузнецовым состоялось в 2010 году в эфире талант-шоу "Х-фактор". Тогда за него проголосовала вся Украина и видимо неспроста.</div>\r\n<div>&nbsp;</div>\r\n<div>Сегодня достижения Алексея просто фантастичны. Ему аплодирует публика в разных уголках мира. Тенор берет уроки вокала у лучших педагогов Италии и Австрии. Стажировки в знаменитых европейских оперных домах и консерваториях позволили Алексею выучить, кроме русского и украинского, английский, немецкий, итальянский, французский языки&hellip;&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Выдающиеся педагоги и дирижеры утверждают, что его теноровый тембр является настоящим чудом, голосом нового тысячелетия &ndash; в нем мягкость Ди Стефано, легкость Паваротти, техника Крауса. О нем говорят: "Нежность и гром в одном флаконе".</div>\r\n<div>&nbsp;</div>\r\n<div>Украинские зрители могли насладиться творчеством исполнителя на концерте Notre Dame de Paris, где артист исполнил партию Клода Фролло. Алексей был прекрасен как в сольных, так и в совместных ариях!</div>\r\n<div>&nbsp;</div>\r\n<div>Его выступления полюбили во Франции, на Кипре, в Австрии, Румынии, Италии, Китае, Венгрии, Испании, Казахстане, и других странах. Сегодня АLEXEI живет и учится в Австрии, а вскоре выступит в столице Украины!</div>\r\n<div>&nbsp;</div>\r\n<div style="text-align: center;"><a href="http://hochu-bilet.com/afisha/aleksej_kuznecov" target="_blank">ХОЧУ БИЛЕТ</a></div>\r\n</div>', 'maestro-san@mail.ru;elina.vedara@mail.ru', 2),
