	(32, 1443761834, NULL, 'SCREAM INC.', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://hochu-bilet.com/Media/files/filemanager/nik_CityLight%20METALLICA.jpg" alt="" width="288" height="432" /></p>\r\n<p class="dateMeasure" style="text-align: center;">Official "Metallica" tribute - группа Scream Inc.! Одна из лучших трибьют-групп легендарной группы "Metallica", в Восточной Европе! В программе концерта - все лучшие песни легендарной группы "Metallica" и не только.</p>\r\n<p>Команда существует с 2008 года, и за это время провела более 300 концертов в Украине, России и Беларуси, а также принимала участие во множественных фестивалях, знаковыми из которых были фестивали Global Battle of The Bands, Про Рок и Monsters of Rock Remake Show. Коллектив пользуется информационной поддержкой таких гигантов сети как Metbash и Metclub (официальные фан-странички и информационные сайты группы Metallica в странах СНГ). В 2013 году группа получила статус Официального Metallica трибьют бэнда с правом исполнения, а также использования песен мирового гранда.</p>\r\n<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/Sxie5a_uisM" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p><iframe style="display: block; margin-left: auto; margin-right: auto;" src="https://www.youtube.com/embed/yyLSKKo4So4" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', 'maestro-san@mail.ru;imex_natali@mail.ru;elina.vedara@mail.ru;korchevskaya.nyuta@mail.ru;vladaolga777@gmail.com;toshibadana@mail.ru;oksana.chaykina@gmail.com;anastasiya_dragan@mail.ru;kudinov-vitali@mail.ru;irina.pianik@mail.ru;ludanova@inbox.ru;steblova.e@mail.ru;galkina-bmw@bk.ru;Viktorija.ev@yandex.ru;lenysik1111@yandex.ru;vitaliyxv@gmail.com;ballo.v@mail.ru;ljuba.vershinina@yandex.ru;makarovaanna07@rambler.ru;leonelka1@rambler.ru;mykmedcol@ukr.net;stasychernega@gmail.com;oksagen.sia@mail.ru;natali-79_79@mail.ru;chegiwara777@mail.ru;electromindster@gmail.com;tennessee@yandex.ru;gaw.sania@yandex.ua;zzzoro88@mail.ru;xxx.genna@mail.ru;zhuravleva23@mail.ru;bandurao@rambler.ru;Sveto4ka_04@mail.ru;ivtavi85@gmail.com;sau311284@rambler.ru;marisha_k.82@mail.ru;marchenko.08@mail.ru;v_odessy@mail.ru', 38),
	(33, 1444205639, NULL, 'Пикник озабоченных или А-ля Кобеля-2', '<p style="text-align: center;"><img src="http://hochu-bilet.com/Media/files/filemanager/kobelya.jpg" alt="kobelya" /></p>\r\n<p style="text-align: center;">2&nbsp;часа смеха от души:)</p>\r\n<p style="text-align: center;">Искрометный, легкий юмор без пошлости:)&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Актёры:&nbsp;Вячеслав Никоноров, Ирина Сопонару, Ирина Андреева, Михаил Спиваковский, Сергей Федорчук<br /><br />Полюбившиеся герои самой громкой премьеры прошлого театрального сезона возвращаются! Три обаятельных шалопая &mdash; Слава, Миша и Сережа &mdash; решили слиться с природой, чтобы в компании своих пассий продолжить вечный творческий поиск любви, секса и семейного счастья. Но можно ли получить все&nbsp;</p>\r\n<p>три опции в одном пакете, не испытав на себе пять типов унижений и не разрушив самой крепкой дружбы?<br />Ведро тонкого юмора, две чайные ложечки здравого цинизма и щепотка душевной лирики &mdash; в новом хитовом коктейле от &laquo;Черного Квадрата&raquo;, получившем три премии на фестивале &laquo;Театральная сессия-2014&raquo;&nbsp;</p>\r\n<p style="text-align: center;"><a href="http://hochu-bilet.com/afisha/piknik_ozabochennyh_ili_a-lja_kobelja_21555" target="_blank">Хочу билет</a></p>', 'maestro-san@mail.ru;imex_natali@mail.ru;elina.vedara@mail.ru;korchevskaya.nyuta@mail.ru;vladaolga777@gmail.com;toshibadana@mail.ru;oksana.chaykina@gmail.com;anastasiya_dragan@mail.ru;kudinov-vitali@mail.ru;irina.pianik@mail.ru;ludanova@inbox.ru;steblova.e@mail.ru;galkina-bmw@bk.ru;Viktorija.ev@yandex.ru;lenysik1111@yandex.ru;vitaliyxv@gmail.com;ballo.v@mail.ru;ljuba.vershinina@yandex.ru;makarovaanna07@rambler.ru;leonelka1@rambler.ru;mykmedcol@ukr.net;stasychernega@gmail.com;oksagen.sia@mail.ru;natali-79_79@mail.ru;chegiwara777@mail.ru;electromindster@gmail.com;tennessee@yandex.ru;gaw.sania@yandex.ua;zzzoro88@mail.ru;xxx.genna@mail.ru;zhuravleva23@mail.ru;bandurao@rambler.ru;Sveto4ka_04@mail.ru;ivtavi85@gmail.