	(39, 1446560549, NULL, 'МАСКИ-ШОУ', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://hochu-bilet.com/Media/files/filemanager/%D0%9C%D0%B0%D1%81%D0%BA%D0%B8%D0%A8%D0%BE%D1%83_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2_%D0%902.jpg" alt="МаскиШоу_Николаев_А2" width="285" height="404" /></p>\r\n<p>&nbsp;</p>\r\n<p>"Маски в кубе" - это комедия без слов о превращении фантазии в реальность и реальности в фантазию. На сцене зрители увидят спектакль-сновидение, где сюжетная линия растворяется в непрерывном потоке сознания. Здесь взрослые становятся детьми, а все серьезное абсурдом. Смешные до умопомрачения сцены сменяются красивыми философскими образами и неожиданными трюковыми ноу-хау. Так же как один сон тут же становится другим, настроение спектакля непредсказуемо меняется от скетча к скетчу. С удивительной пластичностью и мастерством актеры труппы создают не просто пантомимы, а настоящее шоу, драматическую клоунаду, новаторство которой невозможно сравнить с привычными жанрами.</p>\r\n<p style="text-align: center;"><a href="http://hochu-bilet.com/afisha/maski-shou" target="_blank">ХОЧУ БИЛЕТ</a></p>', 'maestro-san@mail.ru;imex_natali@mail.ru;elina.vedara@mail.ru;korchevskaya.nyuta@mail.ru;vladaolga777@gmail.com;toshibadana@mail.ru;oksana.chaykina@gmail.com;anastasiya_dragan@mail.ru;kudinov-vitali@mail.ru;irina.pianik@mail.ru;ludanova@inbox.ru;steblova.e@mail.ru;galkina-bmw@bk.ru;Viktorija.ev@yandex.ru;lenysik1111@yandex.ru;vitaliyxv@gmail.com;ballo.v@mail.ru;ljuba.vershinina@yandex.ru;makarovaanna07@rambler.ru;leonelka1@rambler.ru;mykmedcol@ukr.net;stasychernega@gmail.com;oksagen.sia@mail.ru;natali-79_79@mail.ru;chegiwara777@mail.ru;electromindster@gmail.com;tennessee@yandex.ru;gaw.sania@yandex.ua;zzzoro88@mail.ru;xxx.genna@mail.ru;zhuravleva23@mail.ru;bandurao@rambler.ru;Sveto4ka_04@mail.ru;ivtavi85@gmail.com;sau311284@rambler.ru;marisha_k.82@mail.ru;marchenko.08@mail.ru;v_odessy@mail.ru;lyaskovskaya.anna@mail.ru;voz.lawyer@yande