	(41, 1448214518, NULL, 'Hardy ', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://hochu-bilet.com/Media/files/filemanager/f66c61dc4c6454cb5136144729a98ed5.jpg" alt="f66c61dc4c6454cb5136144729a98ed5" /></p>\r\n<p>Одесский симфонический шоу-оркестр&nbsp;&laquo;Hardy Orchestra&raquo;представляет концептуальную программу из лучших произведений великих Queen!</p>\r\n<p>Николаевцы и гости города услышат свои любимые песни в авторских аранжировках Алексея Андрийчука. Неповторимое слияние рока и классического звучания оркестра и вокал солиста&nbsp;Виктора Романченко, выступавшего на одной сцене с группой Queen, никого не оставят равнодушными!</p>\r\n<p>Концертные выступления симфонического оркестра &laquo;Hardy Orchestra&raquo; это гремучая смесь красоты и драйва рок-музыки, тонкого юмора, без которого истинным одесситам никак не обойтись и высокого исполнительского мастерства музыкантов!</p>\r\n<p>Оригинальные аранжировки и яркий харизматичный дирижер Алексей Андрийчук, превращающий концерт в эффектное шоу, - вот за что публика с первых концертов полюбила Hardy Orchestra.</p>\r\n<p style="text-align: center;"><a title="ХОЧУ БИЛЕТ" href="http://hochu-bilet.com/afisha/map/hardy" target="_blank">ХОЧУ БИЛЕТ</a></p>', 'maestro-san@mail.ru;imex_natali@mail.ru;elina.vedara@mail.ru;korchevskaya.nyuta@mail.ru;vladaolga777@gmail.com;toshibadana@mail.ru;oksana.chaykina@gmail.com;anastasiya_dragan@mail.ru;kudinov-vitali@mail.ru;irina.pianik@mail.ru;ludanova@inbox.ru;steblova.e@mail.ru;galkina-bmw@bk.ru;Viktorija.ev@yandex.ru;lenysik1111@yandex.ru;vitaliyxv@gmail.com;ballo.v@mail.ru;ljuba.vershinina@yandex.ru;makarovaanna07@rambler.ru;leonelka1@rambler.ru;mykmedcol@ukr.net;stasychernega@gmail.com;oksagen.sia@mail.ru;natali-79_79@mail.ru;chegiwara777@mail.ru;electromindster@gmail.com;tennessee@yandex.ru;gaw.sania@yandex.ua;zzzoro88@mail.ru;xxx.genna@mail.ru;zhuravleva23@mail.ru;bandurao@rambler.ru;Sveto4ka_04@mail.ru;ivtavi85@gmail.com;sau311284@rambl