	(43, 1448638206, NULL, 'SINATRA', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://hochu-bilet.com/Media/files/filemanager/sinatra1.jpg" alt="sinatra1" width="332" height="480" /></p>\r\n<div class="textMeasure wTxt">\r\n<p>Путь Легенды!</p>\r\n<p>14 декабря американскому певцу, секс-символу 20 века, обладателю 9 премий Грэмми и премии Оскар великому Френку Синатре исполняется 100&nbsp;лет!</p>\r\n<p>К этой знаменательной дате Performance Big Band Владимира Алексеева с замечательным вокалистом Аликом Шнейдерисом во всех красках исполнят самые известные и популярные песни Фрэнка Синатры. Николаевцы и гости города услышат такие бессмертные шлягеры Синатры как Strangers in the Night, New York, New York, Moon River, Let it snow, Fly me to the Moon, My Way и многие другие.</p>\r\n<p>Такое бывает только раз в 100 лет, господа! Итак, 14 декабря в Областном Дворце Культуры, Вас ждёт волшебный вечер музыки и атмосферы Фрэнка Синатры!</p>\r\n<p>Давайте слушать музыку, созданную на века!</p>\r\n<p style="text-align: center;"><a href="http://hochu-bilet.com/afisha/sinatra" target="_blank">ХОЧУ БИЛЕТ</a></p>\r\n</div>', 'maestro-san@mail.ru;imex_natali@mail.ru;elina.vedara@mail.ru;korchevskaya.nyuta@mail.ru;vladaolga777@gmail.com;toshibadana@mail.ru;oksana.chaykina@gmail.com;anastasiya_dragan@mail.ru;kudinov-vitali@mail.ru;irina.pianik@mail.ru;ludanova@inbox.ru;steblova.e@mail.ru;galkina-bmw@bk.ru;Viktorija.ev@yandex.ru;lenysik1111@yandex.ru;vitaliyxv@gmail.com;ballo.v@mail.ru;ljuba.vershinina@yandex.ru;makarovaanna07@rambler.ru;leonelka1@rambler.ru;mykmedcol@ukr.net;stasychernega@gmail.com;oksagen.sia@mail.ru;natali-79_79@mail.ru;chegiwara777@mail.ru;electromindster@gmail.com;tennessee@yandex.ru;gaw.sania@yandex.ua;zzzoro88@mail.ru;xxx.genna@mail.ru;zhuravleva23@mail.ru;bandurao@rambler.ru;Sveto4ka_04@mail.ru;ivtavi85@gmail.com;sau311284@rambler.ru;marisha_k.82@mail.ru;marchenko.08@mail.ru;v_odessy@mail.ru;lyaskovskaya.anna@mail.ru;voz.lawyer