	(44, 1449439751, NULL, '"Двое на качелях"', '<p style="text-align: center;"><strong><img src="http://hochu-bilet.com/Media/files/filemanager/HB_218x327_1.jpg" alt="HB_218x327_1" /></strong></p>\r\n<p>В ролях:</p>\r\n<p><strong>Татьяна Арнтгольц</strong></p>\r\n<p><strong>Григорий Антипенко</strong></p>\r\n<p><strong>Пьеса &laquo;Двое на качелях&raquo;</strong>&nbsp;(Two for the Seesaw), &nbsp;написанная в 1958 году, до сих пор популярна и имеет огромную постановочную историю. В ней столько поворотов сюжета, столько блестящих диалогов и маленьких крылатых фраз, в ней есть настоящая сила чувств и неподдельная жизнь. И главное &mdash; в ней столько любви! Пьесу ставили на Бродвее, ее экранизация имела ошеломляющий успех, а спектакли до сих пор не сходят с афиш театров мира.</p>\r\n<p><strong>Спектакль &laquo;Двое на качелях&raquo;</strong>&nbsp;&ndash; это история двух сердец &ndash; несчастных, отчаянно одиноких и столь непохожих. Трогательная и смешная, а подчас &ndash; жестокая, впрочем&hellip; как и сама жизнь.</p>\r\n<p>Эта история случилась в огромном Нью-Йорке. Но она могла произойти в любом другом большом городе. Танцовщица&nbsp;Гитель и ее случайный знакомый адвокат&nbsp;Джерри неожиданно и вдруг становятся близкими людьми. Они тянутся друг к другу. Вначале просто от одиночества, оттого, что ни его, ни ее никто не ждет дома. Каждый из них ищет соломинку, которая поможет удержаться и не утонуть. Случайная пара &mdash;&nbsp;неустойчивые отношения, как качели.&nbsp;Их бросает из одной крайности в другую, они&nbsp; сорятся, мирятся, расходятся и снова сходятся &ndash; такие заносчивые, вспыльчивые и влюбленные, они пытаются понять друг друга... Эта встреча переворачивает всю их жизнь. Эти двое помогли друг другу выжить, поверить в себя, обрести настоящее желание жить.&nbsp;</p>\r\n<p style="text-align: center;"><a href="http://hochu-bilet.com/afisha/dvoe_na_kacheljah" target="_blank">ХОЧУ БИЛЕТ</a></p>\r\n<p>&nbsp;</p>', 'maestro-san@mail.ru;imex_natali@mail.ru;e